import React from 'react'
import { useRef } from 'react'
import logo from '../logo.png'
// import style from '../style.css'



const Navbar = () => {
    const navRef = useRef()

    const showNavbar = () => {
        navRef.current.classlist.toggle()
    }


  return (
    <header>
        <img src={logo} alt="minerva" />
        <nav>
            <a href='/#'>Home</a>
            <a href='/#'>Testimoni</a>
            <a href='/#'>Kontak</a>
            <a href='/#'>Masuk</a>
        </nav>
    </header>
  );
}

export default Navbar
